import React, { Component } from 'react';

class NewClassForm extends Component {
	render() {
		return (
			<div>
				<h1>Enter a new class</h1>
				<form>
					<p><label>Class Name</label>
					<input type="text" /></p>
					<input type="submit" />
				</form>
			</div>
		);
	}
}

export default NewClassForm;
